import "css-reset-and-normalize";
import "react-big-calendar/lib/css/react-big-calendar.css";
import React from "react";
import { BrowserRouter, Route } from "react-router-dom";
import EventTool from "./EventTool";

function Login() {
  return (
    <div>
      <button
        as="a"
        href="https://www.eventbrite.com/oauth/authorize?response_type=token&client_id=YOUR_API_KEY&redirect_uri=event"
      >
        Login
      </button>
    </div>
  );
}
function App() {
  return (
    <BrowserRouter>
      <Route path="/" component={Login} />
      <Route path="/event" component={EventTool} />
    </BrowserRouter>
  );
}

export default App;
